import React, { useEffect, useState } from 'react';
import Header from './Header';
import Footer from './Footer';
import MainCSS from './styles/Main.module.css'

function Root(props) {
  let [data, setData] = useState([])

  let getDataAPI = async function () {
    let response = await fetch('/create').then(res => res.text())
    return response
    // setData(data.push(response))
  }

  useEffect(() => {
    console.log(getDataAPI())
    // console.log(data)
  }, [])

  return (<>
    <Header />
    <main>
      <div className={MainCSS.wrapper}>
        {props.component}
      </div>
    </main>
    <Footer />
  </>);
}

export default Root;
